o.x:
var $bm_rt;
var freq;
var fx = effect('Opacity Blink');
var phase = fx(3).value;
var timeOn = fx(4).value;
var offset = fx(5).value;
var valueA = fx(1).value;
var valueB = fx(2).value;
freq = $bm_div(timeToFrames(1), phase);
var currentFrame = timeToFrames($bm_sum(time, $bm_div($bm_div(offset, phase), 100)));
if ($bm_mod(currentFrame, freq) > $bm_div($bm_mul(freq, timeOn), 100))
    $bm_rt = valueB;
else
    $bm_rt = valueA;

